	this.timeline.addTween(cjs.Tween.get({}).to({state:[]}).to({state:[{t:this.shape_1},{t:this.shape}]},1).to({state:[]},1).wait(2));

	// Code
	this.instance = new lib.SpikeBall();
	this.instance.setTransform(1542.85,295,1,1,0,0,0,-0.6,-0.8);

	this.instance_1 = new lib.Pinecone();
	this.instance_1.setTransform(1592.9,396.55,1,1,0,0,0,-0.8,0.8);

	this.instance_2 = new lib.SpikeBall();
	this.instance_2.setTransform(1441.85,384.95,1,1,0,0,0,-0.6,-0.8);

	this.timeline.addTween(cjs.Tween.get({}).to({state:[]}).to({state:[{t:this.instance_2},{t:this.instance_1},{t:this.instance}]},2).to({state:[]},1).wait(1));

	// lives
	this.lifeBox = new lib.lifeBox();
	this.lifeBox.name = "lifeBox";
	this.lifeBox.setTransform(199.1,76,0.7938,0.866,0,0,0,104.9,29);
