	this.timeline.addTween(cjs.Tween.get(this.lifeBox).wait(2).to({_off:false},0).to({_off:true},1).wait(1));

	// score
	this.scoreText = new cjs.Text("Score:", "35px 'Shadows Into Light'", "#4C2400");
